function Footer() {
    return (
        <div className="foooter-main">
            <div>
                <img classname="zomato-image" src="https://b.zmtcdn.com/web_assets/b40b97e677bc7b2ca77c58c61db266fe1603954218.png" alt="zom"></img>
            </div>
            
        </div>
    )
}

export default Footer
